import "./add-company.css";
import { Field, Formik, Form, ErrorMessage } from 'formik'




export default function AddCompany() {
    const handleSubmit = (values) => {
    }


    return (
        <div className="AddCompany">
            <button type="submit" class="btn btn-primary my-1" title="Add">

            </button>

            <h2>Add Company</h2><br />

            <Formik

                initialValues={{ email: "", password: "", name: "" }}
                onSubmit={(values, { setFieldValue }) => handleSubmit(values, { setFieldValue })}

            >
                {({ isValid, dirty, values }) => (
                    <Form >
                        <div class="form-group">
                            <label class="control-label col-sm-2"> Company Name:  </label>
                            <Field class="col-sm-2"
                                type="name"
                                name="name"
                                placeholder="Enter Company Name"
                                required={true}
                                autocomplete={true}
                            />
                        </div>


                        <div class="form-group">

                            <label class="control-label col-sm-2" > Enter your Email </label>
                            <Field class="col-sm-2"
                                type="email"
                                name="email"
                                placeholder="Enter your Email"
                                title={values.email}
                                required={true}
                                autocomplete={true}
                            />

                        </div>
                        <div class="form-group">
                            <label class="control-label col-sm-2"> Enter your Password </label>
                            <Field class="col-sm-2"
                                type="password"
                                name="password"
                                placeholder="Enter your Password"
                                required={true}
                                autocomplete={true}
                            />
                        </div>

                        <button type="submit" class="btn btn-primary my-1" title="Add">
                            Add
                        </button>

                    </Form>
                )}
            </Formik >

        </div>




    )
}
